def extract_info(data_string, start, finish):
    lens = []
    
    # Regular expressions for extracting the desired data
    len_pattern = re.compile(r'Len: (\d+\.\d{9})$')

    # Split the data string into lines and process each line
    for line in data_string.split("\n"):
        # Extract queue size
        match = len_pattern.search(line)
        if match:
          lens.append(match.group(1))

    lens = [float(i) for i in lens]
    utilization = sum(lens)/(finish-start)

    return utilization


# Copied from eval2ef.py
def stats(text):
  pattern = re.compile(r"Sent: (\d+\.\d+) Recv: (\d+\.\d+)")
      
  matches = pattern.findall(text)

  resp_time = [float(recv) - float(sent) for sent, recv in matches]

  avg_resp = sum(resp_time) / len(resp_time)

  return avg_resp

# Copied from Eval_2a.py
def timed_average(data, first_complete, last_complete):
  def extract_info(data_string):
      queue_sizes = []
      completion_times = []
      
      # Regular expressions for extracting the desired data
      queue_pattern = re.compile(r'Q:\[([^\]]*)\]')
      completion_pattern = re.compile(r'(\d+\.\d{6})$')  # Now capturing floating point numbers

      # Split the data string into lines and process each line
      for line in data_string.split("\n"):
          # Extract queue size
          match = queue_pattern.search(line)
          if match:
              queue_content = match.group(1).strip()
              if queue_content:  # Check if the list is not empty
                  queue_sizes.append(len(queue_content.split(',')))
              else:
                  queue_sizes.append(0)

          # Extract completion time
          match = completion_pattern.search(line)
          if match:
              completion_times.append(float(match.group(1)))

      return queue_sizes, completion_times

  queue_sizes, completion_times = extract_info(data)

  time_elapsed = [completion_times[i+1] - completion_times[i] for i in range(len(completion_times)-1)]
  queue_sizes = queue_sizes[:-1]

  sum = 0
  for i in range(999):
      sum += time_elapsed[i] * queue_sizes[i]

  timed_avg = sum/(first_complete - last_complete)
  
  return timed_average


